export default function ProjectList({curState, verticalMode}) {
    return (
    <>
    <section id="project-list">
        <div className="separator"></div>
        {/* <div className={verticalMode ? "center-wrapper" : "center-wrapper thin"}> */}
        <div margin="auto" width="100vw">
            <ProjectIcons curState={curState} verticalMode={verticalMode}/>
        </div>
        {/* </div> */}
    </section>
    </>
    );
}

function ProjectIcons({curState, verticalMode}) {
    let table = (<div id="project-table" className={verticalMode ? "thin" : ""}>
        {Object.keys(curState.projInfoList).map(projectKey => {
            let projectInfo = curState.projInfoList[projectKey];
            return (
            <div className={verticalMode ? "project-icon-wrapper thin" : "project-icon-wrapper"}>
                <div className="project-title">{projectInfo.title}</div>
                <img className="project-image" src={projectInfo.imgsrc} alt={projectInfo.title + " icon"}/>
            </div>);
        })}
    </div>);

    return table;
}
